const fetch = require('node-fetch');       

  function search(query, cb) {
    fetch(`http://localhost:81/api/marco?q=${query}`,{method: 'GET'})
    .then(res => res.json())
    .then(cb);
  }

  
  const Client = { search };
  export default Client;
